import React, { useState, useEffect } from 'react';
import { FaSubscript, FaUserFriends, FaCreditCard, FaFileAlt } from 'react-icons/fa';
import { SimplePieChart, SimpleBarChart } from './SimpleCharts';
import axios from 'axios';

const DashboardContent = () => {
  const [stats, setStats] = useState({});
  const [subscribers, setSubscribers] = useState([]);
  const [subscriptions, setSubscriptions] = useState([]);
  const [transactions, setTransactions] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      const [statsRes, subscribersRes, subscriptionsRes, transactionsRes] = await Promise.all([
        axios.get('http://localhost:8000/api/dashboard-stats/'),
        axios.get('http://localhost:8000/api/subscribers/'),
        axios.get('http://localhost:8000/api/subscriptions/'),
        axios.get('http://localhost:8000/api/transactions/')
      ]);

      setStats(statsRes.data);
      setSubscribers(subscribersRes.data);
      setSubscriptions(subscriptionsRes.data);
      setTransactions(transactionsRes.data);
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
    } finally {
      setLoading(false);
    }
  };

  // Prepare chart data
  const activeSubscribersData = {
    active: subscribers.filter(s => s.status === 'active').length,
    inactive: subscribers.filter(s => s.status === 'inactive').length,
  };

  const subscriptionTypesData = {
    labels: [...new Set(subscriptions.map(s => s.subscription_type))],
    values: [...new Set(subscriptions.map(s => s.subscription_type))].map(type =>
      subscriptions.filter(s => s.subscription_type === type).length
    ),
  };

  const userTypesData = {
    labels: ['Active Users', 'Inactive Users'],
    values: [activeSubscribersData.active, activeSubscribersData.inactive],
  };

  const monthlyRevenueData = {
    labels: ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun'],
    values: [12000, 15000, 18000, 22000, 25000, 28000],
  };

  if (loading) {
    return (
      <div className="animate-pulse">
        <div className="grid grid-cols-1 md:grid-cols-4 gap-6 mb-8">
          {[1, 2, 3, 4].map(i => (
            <div key={i} className="bg-white shadow rounded-lg p-5">
              <div className="h-4 bg-gray-200 rounded w-3/4 mb-2"></div>
              <div className="h-8 bg-gray-200 rounded w-1/2"></div>
            </div>
          ))}
        </div>
      </div>
    );
  }

  return (
    <div>
      {/* Stats Cards */}
      <div className="grid grid-cols-1 md:grid-cols-4 gap-6 mb-8">
        <div className="bg-white/70 backdrop-blur-md overflow-hidden shadow-xl rounded-2xl border border-white/20 hover:shadow-2xl transition-all duration-300">
          <div className="p-6">
            <div className="flex items-center justify-between">
              <div>
                <p className="text-sm font-semibold text-gray-600 uppercase tracking-wide">Subscriptions</p>
                <p className="text-3xl font-bold bg-gradient-to-r from-blue-600 to-blue-800 bg-clip-text text-transparent">{stats.total_subscriptions || 0}</p>
              </div>
              <div className="bg-gradient-to-r from-blue-500 to-blue-600 p-3 rounded-xl">
                <FaSubscript className="h-6 w-6 text-white" />
              </div>
            </div>
          </div>
        </div>
        <div className="bg-white/70 backdrop-blur-md overflow-hidden shadow-xl rounded-2xl border border-white/20 hover:shadow-2xl transition-all duration-300">
          <div className="p-6">
            <div className="flex items-center justify-between">
              <div>
                <p className="text-sm font-semibold text-gray-600 uppercase tracking-wide">Active Subscribers</p>
                <p className="text-3xl font-bold bg-gradient-to-r from-green-600 to-green-800 bg-clip-text text-transparent">{stats.active_subscribers || 0}</p>
              </div>
              <div className="bg-gradient-to-r from-green-500 to-green-600 p-3 rounded-xl">
                <FaUserFriends className="h-6 w-6 text-white" />
              </div>
            </div>
          </div>
        </div>
        <div className="bg-white/70 backdrop-blur-md overflow-hidden shadow-xl rounded-2xl border border-white/20 hover:shadow-2xl transition-all duration-300">
          <div className="p-6">
            <div className="flex items-center justify-between">
              <div>
                <p className="text-sm font-semibold text-gray-600 uppercase tracking-wide">Transactions</p>
                <p className="text-3xl font-bold bg-gradient-to-r from-purple-600 to-purple-800 bg-clip-text text-transparent">{stats.total_transactions || 0}</p>
              </div>
              <div className="bg-gradient-to-r from-purple-500 to-purple-600 p-3 rounded-xl">
                <FaCreditCard className="h-6 w-6 text-white" />
              </div>
            </div>
          </div>
        </div>
        <div className="bg-white/70 backdrop-blur-md overflow-hidden shadow-xl rounded-2xl border border-white/20 hover:shadow-2xl transition-all duration-300">
          <div className="p-6">
            <div className="flex items-center justify-between">
              <div>
                <p className="text-sm font-semibold text-gray-600 uppercase tracking-wide">Revenue</p>
                <p className="text-3xl font-bold bg-gradient-to-r from-orange-600 to-orange-800 bg-clip-text text-transparent">${stats.revenue || 0}</p>
              </div>
              <div className="bg-gradient-to-r from-orange-500 to-orange-600 p-3 rounded-xl">
                <FaFileAlt className="h-6 w-6 text-white" />
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Charts */}
      <div className="grid grid-cols-1 lg:grid-cols-2 gap-6 mb-8">
        {/* Pie Chart - Active Subscribers */}
        <div className="bg-white/70 backdrop-blur-md shadow-xl rounded-2xl p-6 border border-white/20 hover:shadow-2xl transition-all duration-300">
          <div className="flex items-center justify-between mb-4">
            <h3 className="text-lg font-bold text-gray-800">Active vs Inactive Subscribers</h3>
            <div className="w-3 h-3 bg-gradient-to-r from-blue-500 to-purple-500 rounded-full"></div>
          </div>
          <SimplePieChart 
            data={activeSubscribersData} 
            title="" 
          />
        </div>

        {/* Bar Chart - User Types */}
